    for (int32 Idx = 0; Idx < ImagesArray.Num(); Idx++)
    {
        TSharedPtr<FJsonValue> CurrentItem = ImagesArray[Idx];
        Images.Add(FImage(CurrentItem->AsObject()));
    }


